typeProperties.script:
section Section1;
shared moviesDS = let
  AdfDoc = AzureStorage.BlobContents("https://mablumenadf.blob.core.windows.net/movies/123test.csv"),
  Csv = Csv.Document(AdfDoc, [Delimiter = ",", Encoding = TextEncoding.Utf8, QuoteStyle = QuoteStyle.Csv])
in
  Csv;
shared UserQuery = let
  Source = moviesDS
in
  Source;
